import React from "react";
import 'bootstrap/dist/css/bootstrap.css';
import "./Navigation.css";
import Aux from "../../hoc/aux";

const navigation = (props) => {
  return (
    <Aux>
      <div className="navbar w-100 bg-dark text-light pt-3 pb-3 d-flex justify-content-between">
        <a href="/" className="text-decoration-none text-light
        "><div className="ms-3 brander">Shrink It...</div></a>
        <a href="https://github.com/captcha781/" className="text-light"><i class="me-3 fa-brands fa-github github"></i></a>
        <a href="https://twitter.com/iamrealbhuvi/" className="text-light"><i class="me-3 fa-brands fa-twitter github"></i></a>
      </div>
    </Aux>
  );
};


export default navigation
